(1, 'ঘাটাইল এস.ই পাইলট বালিকা উচ্চ বিদ্যালয়', 'শিক্ষা জাতির মেরুদন্ড', '০২-০২-১৯৪৫ইং', '১১৪১২০', '', 'Untitled-1.png', '', '০১৭১১০৪২৮০০', 'ghatail.s.e.pilothighschool@gmail.com', ' ঘাটাইল পৌরসভা, ঘাটাইল,  টাঙ্গাইল। ', 'http://www.gsepghs.edu.bd', 'http://www.tritiyo.com', '9:30AM to 4:00 PM', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m10!1m8!1m3!1d3629.5725033535746!2d89.9839227!3d24.5348707!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2sbd!4v1437993374527\" allowfullscreen></iframe>', 'অত্র প্রতিষ্ঠান টাঙ্গাইল জেলার ঘাটাইল উপজেলার ৮নং ওয়ার্ডে পৌরসভার প্রাণকেন্দ্রে বিদ্যালয়টি অবস্থিত। বিদ্যালয়টি টাঙ্গাইল ময়মনসিংহ, জামালপুর, শেরপুর ও গোপালপুর একটি মহাসড়কের ১০০ গজ পশ্চিম পাশে অবস্থিত।  ', 'বুলবুলি বেগম', '৮৮০-১৭১২ ৫২৪৫৯৬', 'bolbolibegum123@gmail.com', 'Head_Teacher.jpg', 'Head_Teacher.jpg', ' শিক্ষার জ্ঞান মানুষের মনের প্রসারণ, জীবন ও পৃথিবী সম্বন্ধে নতুন চিন্তার উদ্ভাবন ঘটায়। শিক্ষা জাতির মেরুদন্ড হয়ে দাড়ায় তখনই, যখন একটি জাতি মানবীয় মূল্যবোধে উজ্জীবিত হয়ে শিক্ষাবান্ধব স্থিতিশীল সমাজ ও কার্যকর রাষ্ট্র প্রতিষ্ঠার মাধ্যমে উন্নত থেকে উন্নতর ভবিষ্যৎ নির্মাণে চেষ্টিত হয়। আর এ জন্য প্রয়োজন সুশিক্ষা। জ্ঞান অর্জনের সুশিক্ষার কোন বিকল্প নেই। টাংগাইল জেলার ঘাটাইল থানায় ৮নং ওয়ার্ডে পৌরসভার প্রাণকেন্দ্রে ১৯৪৫ ইং সনের ২রা জানুয়ারী এলাকার গণ্যমান্য ব্যক্তিবর্গের ঐকান্তিক প্রচেষ্ঠায় গড়ে উঠেছিল ঘাটাইল এস.ই পাইলট বালিকা উচ্চ বিদ্যালয়। সেই থেকে পথ চলা। বিদ্যালয়টি এই এলাকার মানুষের মাঝে বিদ্যার আলো ছড়িয়ে যাচ্ছে । ', 'blankavatar.jpg', 'bluetheme', NULL, NULL, NULL);
