(19, 'লক্ষ ও উদ্দেশ্য', 'our-goal', NULL, 1, 0, 'বিদ্যালয়টির অবকাঠামোগত উন্নয়ন পরিকল্পনা রয়েছে। সকল প্রকার পরীক্ষার ফলাফল ভাল। ছাত্রী সংখ্যা বৃদ্ধি। শিক্ষার্থী ঝড়েপড়া রোধ, শিক্ষার্থীর গুণগত মান বৃদ্ধিসহ বিদ্যালয়টিকে একটি মডেল বিদ্যালয় হিসাবে রুপান্তরিত করার পরীকল্পনা রয়েছে।  \r\nযোগাযোগ', '2015-10-08', 0, 1, 1),
