(55, 'ইতিহাস', 'history', NULL, 1, 4, 'বিদ্যালয়টি ০৪ জন শিক্ষক কর্মচারী ও ৫০ জন ছাত্রী নিয়ে পাঠদান কার্যক্রম শুরু করে। নিু মাধ্যমিক বিদ্যালয় হিসাবে প্রাথমিক পাঠদান ০১-০৭-১৯৬৩ খ্রিঃ থেকে অস্থায়ী স্বীকৃতি প্রাপ্ত হয়। বিদ্যালয়টি ০১-০১-১৯৬৭খ্রিঃ থেকে নবম শ্রেণি পাঠদানের অনুমতি পায়। ০১-০১-১৯৬৮খ্রিঃ হতে মাধ্যমিক একাডেমিক স্বীকৃতি প্রাপ্ত হয়। ইতিমধ্যে বিদ্যালয়টি বিজ্ঞান শাখা, মানবিক শাখা, ও ব্যবসায় শিক্ষা শাখা সহ কম্পিউটার শিক্ষা বিষয়, কৃষি শিক্ষা বিষয় এবং হিন্দু ধর্ম বিষয় খোলার অনুমতি পেয়েছে। শিক্ষা বোর্ডের আওতাধীন ০৯-০৬-১১৯৯৯ খ্রিঃ বিদ্যালয়টিতে একটি কারিগরী ভোকেশনাল শাখা খোলার অনুমতি প্রাপ্ত হয়। বর্তমানে শিক্ষক ও কর্মচারী সংখ্যা ২৫ জন এছাড়া ছাত্রী সংখ্যা ৭৬১ জন। ', '1450401420', 0, 1, 1),
